function sbox_url(url){
    var qrcode = new QRCode(document.getElementById("urloutput"), {
        text : url,
        width: 800,
        height: 800,
        correctLevel : QRCode.CorrectLevel.H,
        dotScale: 0.49,

        // ====== Quiet Zone
        quietZone: 10,
        quietZoneColor: 'white',

        // icon
        logo: 'data:image/png;base64,',
        logoBackgroundTransparent: true

    });
}
